import React from 'react';
import Slider from 'react-slick';

const TodoTabletElement = () => {
  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1
  };

  return (
    <Slider {...settings}>
      <div>Test</div>
    </Slider>
  );
};

export default TodoTabletElement;
